Para determinar si "data" es un modismo colombiano, necesitas evaluar si se utiliza de manera figurada o culturalmente en el contexto colombiano. Si "data" no es una expresión figurada específicamente con connotaciones culturales colombianas, no debería clasificarse como un modismo.

Por ejemplo, si "data" solo se refiere al contenido literal de información, no es idiomática. Por lo tanto, el valor de "es_modismo" debería ser "No" si no se le puede otorgar una caracterización idiomática culturalmente colombiana.

Por favor, da el modismo o el contexto de la expresión usando el conocimiento disponible interno de modismos colombianos. Si conoces un contexto específico donde "data" se utilice en Colombia como un modismo, entonces deberías clasificarla como "Sí", de lo contrario "No".

